(1, 36, 'Производство упаковки оптом', 'pozhelaniya-klientov-v-tsentre-nashego-vnimaniya', '', '<p>&#1050;&#1086;&#1084;&#1087;&#1072;&#1085;&#1080;&#1103; &#1060;&#1083;&#1086;&#1088;&#1080;&#1089;&#1055;&#1072;&#1082; &#1088;&#1072;&#1073;&#1086;&#1090;&#1072;&#1077;&#1090; &#1076;&#1083;&#1103; &#1074;&#1072;&#1089; &#1087;&#1086;&#1095;&#1090;&#1080; &#1076;&#1074;&#1072;&#1076;&#1094;&#1072;&#1090;&#1100; &#1083;&#1077;&#1090;. &#1053;&#1072;&#1095;&#1080;&#1085;&#1072;&#1103; &#1089; &#1087;&#1077;&#1088;&#1074;&#1099;&#1093; &#1076;&#1085;&#1077;&#1081; &#1086;&#1089;&#1085;&#1086;&#1074;&#1072;&#1085;&#1080;&#1103; &#1074; 1996 &#1075;&#1086;&#1076;&#1091;, &#1084;&#1099; &#1086;&#1089;&#1091;&#1097;&#1077;&#1089;&#1090;&#1074;&#1083;&#1103;&#1077;&#1084; &#1087;&#1088;&#1086;&#1080;&#1079;&#1074;&#1086;&#1076;&#1089;&#1090;&#1074;&#1086; &#1091;&#1087;&#1072;&#1082;&#1086;&#1074;&#1082;&#1080; &#1076;&#1083;&#1103; &#1094;&#1074;&#1077;&#1090;&#1086;&#1074; &#1089; &#1085;&#1072;&#1085;&#1077;&#1089;&#1077;&#1085;&#1080;&#1077;&#1084; &#1085;&#1072; &#1077;&#1077; &#1087;&#1086;&#1074;&#1077;&#1088;&#1093;&#1085;&#1086;&#1089;&#1090;&#1100; &#1087;&#1086; &#1078;&#1077;&#1083;&#1072;&#1085;&#1080;&#1102; &#1082;&#1083;&#1080;&#1077;&#1085;&#1090;&#1072; &#1083;&#1086;&#1075;&#1086;&#1090;&#1080;&#1087;&#1072; &#1082;&#1086;&#1084;&#1087;&#1072;&#1085;&#1080;&#1080; &#1080;&#1083;&#1080; &#1083;&#1102;&#1073;&#1086;&#1075;&#1086; &#1088;&#1080;&#1089;&#1091;&#1085;&#1082;&#1072; &#1084;&#1077;&#1090;&#1086;&#1076;&#1086;&#1084; &#1084;&#1085;&#1086;&#1075;&#1086;&#1094;&#1074;&#1077;&#1090;&#1085;&#1086;&#1081; &#1092;&#1083;&#1077;&#1082;&#1089;&#1086;&#1075;&#1088;&#1072;&#1092;&#1080;&#1095;&#1077;&#1089;&#1082;&#1086;&#1081; &#1087;&#1083;&#1077;&#1085;&#1086;&#1095;&#1085;&#1086;&#1081; &#1087;&#1077;&#1095;&#1072;&#1090;&#1080;.</p>\r\n<p>&#1044;&#1083;&#1103; &#1074;&#1072;&#1089; &#1084;&#1099; &#1080;&#1079;&#1075;&#1086;&#1090;&#1086;&#1074;&#1080;