'2013-06-10 16:21:24', 734, '', '2014-12-12 09:18:12', 734, 734, '2016-09-13 10:20:07', '2013-06-10 16:21:24', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 11, 0, 24, '', 'Производство упаковочных изделий для цветов,пищевых проуктов, текстиля предлагает компания "ФлорисПак". Выгодные цены! Звоните!  ☎  +7 (812) 496-22-84', 1, 87037, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(2, 37, 'Упаковка для цветов', 'upakovka-dlya-tsvetov', '', '<p><img src="templates/florispack/images/18.jpg" border="0" width="200" style="border: 0; float: right;" /><img src="templates/florispack/images/19.jpg" border="0" width="200" style="float: left;" />Яркая, красочная, удобная и функциональная упаковка привлекает внимание покупателей, увеличивает объем продаж товара. МЫ производим все типы упаковки а так же учитываем ваши пожелания.</p>\r\n<p align="justify">Фабрика печати предлагает нашим партнерам и заказчикам широчайший спектр продукции и услуг.</p>\r\n<p align="justify">Нашими специалистами разработано большое количество различных типов упаковки для цветов, да же если у вас не стандартный заказ, мы постараемся вам помочь максимально быстро с сохранением качества продукции.</p>\r\n<p><img src="templates/florispack/images/20.jpg" border="0" width="200" style="float: right; clear: left; border: 0; margin-top: 5pxpx; margin-bottom: 5pxpx;" /></p>\r\n<p align="justify">Кроме того, современные упаковки для продуктов не обязательно являются стандартными, а могут иметь различные формы, в зависимости от фантазии дизайнера. Необычная упаковка помогает выделить товар на прилавке и обратить на него повышенное внимание потребителя.</p>', '', 1, 0, 0, 8, '2013-06-10 16:48:05', 734, '', '2016-09-13 11:11:08', 734, 0, '0000-00-00 00:00:00', '2013-06-10 16:48:05', '0000-00-00 00:00:00', '{"image_intro":"images\\/1.png","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"