(4, 39, 'Упаковка для цветов оптом', 'upakovki-optom', '', '<p>Качественный упаковочный материал чрезвычайно важен для сохранности полезных свойств продукции и ее эстетических достоинств. В последнее время завоевывает рынок упаковки из пропилена. Они отличаются повышенной износостойкостью, устойчивостью к перепадам температур и размножению болезнетворных микроорганизмам. Кроме того, полипропиленовая пленка никак не влияет на естественный аромат продукции, а, наоборот, сохраняет его в полной мере. Ее с успехом используют во всех отраслях промышленности — для упаковки лекарственных препаратов, пищевых продуктов, бытовых моющих средств, текстиля, овощей и фруктов.</p>\r\n<p>Компания <span style="color: #666666; font-family: Helvetica, Arial, sans-serif; font-size: 16px; font-weight: bold; line-height: 1.3em;">«</span><span style="line-height: 1.3em; font-weight: bold;">ФлорисПак</span><span style="color: #666666; font-family: Helvetica, Arial, sans-serif; font-size: 16px; font-weight: bold; line-height: 1.3em;">»</span> работает уже более 10 лет в производстве упаковочной продукции на основе полипропиленовой пленки высокого качества, поставляя свою продукцию в мелкие и крупные промышленные предприятия по всей России. Также компания предоставляет услуги по многоцветной флексографической печати, изготовляя полипропиленовую пленку эксклюзивного дизайна — в зависимости от преследуемых целей и пожеланий клиента.</p>\r\n<p>Если ваш бизнес связан с продажей зелени, цветов, брендовой одежды, то наша продукция станет отличной рекламой товару. Необычная, оригинальная упаковка для цветов оптом от ФлорисПак — это гарантия процветания вашей компании. Наши покупатели могут рассчитывать на быстрое выполнение заказа, неукоснительное соблюдение оговоренных сроков и гибкую систему скидок.</p>\r\n<p>Упаковочная продукция <span style="color: #666666; font-family: Helvetica, Arial, sans-serif; font-size: 16px; font-weight: bold; line-height: 1.3em;">«</span><span style="font-weight: bold; line-height: 1.3em;">ФлорисПак</span><span style="color: #666666; font-family: Helvetica, Arial, sans-serif; font-size: 16px; font-weight: bold; line-height: 1.3em;">» </span><span style="line-height: 1.3em;">— это всегда стабильно высокое качество, более чем приемлемые цены и богатый ассортимент. У нас вы можете </span><span style="line-height: 1.3em;">оптом купить упаковку для цветов</span><span style="line-height: 1.3em;">, бытовой химии, овощей и текстиля. Мы нацелены на продуктивное сотрудничество и всегда рады новым клиентам!</span></p>\r\n<p>Цены можно посмотреть тут:  <a href="prajs-list">Цены на упаковочную продукцию</a></p>\r\n<p>Для более подробной информации звоните по телефону: <span style="color: #2a471c; font-size: medium;"><strong>(812) 496-22-84 и +7(904)515-90-06</strong></span></p>', '', 1, 0, 0, 2, '2013-06-10 17:09:19', 734, '', '2013-06-27 10:40:14', 734, 734, '2016-07-15 07:48:15', '2013-06-10 17:09:19', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 5, 0, 21, '', 'Купить упаковку для цветов оптом можно в компании "ФлорисПак" (г.Санкт-Петербург).  Звоните!  ☎  +7 (812) 496-22-84', 1, 11078, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(5, 40, 'Услуги', 'uslugi', '', '<p>Картонная упаковка используется практически во всех отраслях производства. Яркая, красочная, удобная и функциональная упаковка привлекает внимание покупателей, увеличивает объем продаж товара. Фабрика печати "Конди-Центр" производит упаковку из всех видов картона, гофрокартона и микрогофрокартона.</p>\r\n<p align="justify">Фабрика печати предлагает нашим партнерам и заказчикам широчайший спектр продукции и услуг, связанных с рынком микрогофрокартона, гофротары, картонных коробки и другой тары и упаковки.</p>\r\n<p align="justify">Нашими специалистами разработано большое количество различных конструкций коробок из картона и микрогофрокартона, что позволяет нашим клиентам широко применять гофрокартон и его производные.</p>\r\n<p align="justify">Кроме того, современные упаковки для продуктов не обязательно являются стандартными квадратными коробками, а могут иметь различные формы, в зависимости от фантазии дизайнера. Необычная упаковка помогает выделить товар на прилавке и обратить на него повышенное внимание потребителя.</p>', '', 1, 0, 0, 2, '2013-06-10 17:09:52', 734, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2013-06-10 17:09:52', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, 20, '', '', 1, 110, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(6, 41, 'Контакты', 'kontakty', '', '<p>e-mail: info@florispack.ru</p>\r\n<p>Адрес: 197342, Россия, г. Санкт-Петербург, наб. Чёрной речки, д. 41</p>\r\n<p>Тел./факс: (812) 4962284</p>\r\n<p>Моб.: +7 (904) 5159006</p>\r\n<p>{loadposition map}</p>\r\n<p style="margin: 0px; padding: 0px;"> </p>', '', 1, 0, 0, 2, '2013-06-10 17:10:18', 734, '', '2013-06-25 12:44:53', 734, 0, '0000-00-00 00:00:00', '2013-06-10 17:10:18', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 4, 0, 19, '', '', 1, 9128, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(7, 42, 'Упаковка для живых цветов', 'upakovka-dlya-zhivykh-tsvetov', '', '<p>На сегодняшний день компания является одним из крупнейших поставщиков упаковочной продукции от лучших производителей Италии, Польши, Дании, Германии, Голландии и Таиланда. Обширная география сотрудничества позволяет нам комбинировать ассортимент из товаров отечественного и импортного производства, для того чтобы Вы могли выбрать самые оригинальные идеи и решения для Вашего цветочного магазина.</p>', '', 1, 0, 0, 2, '2013-06-11 03:26:21', 734, '', '0000-00-00 00:00:00', 0, 734, '2016-07-15 15:28:05', '2013-06-11 03:26:21', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, 18, '', '', 1, 26, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(8, 43, 'Упаковка для свежей зелени', 'upakovka-dlya-svezhej-zeleni', '', '<p><img src="templates/florispack/images/16.jpg" border="0" width="250" style="border: 0; float: right;" />Ни одно блюдо не обходится без ароматной, сочной зелени петрушки, укропа, базилика или салата. У каждой хозяйки есть множество коронных рецептов с обязательным использованием свежей зелени — источника не только аппетитного аромата, но и незаменимых полезных веществ.</p>\r\n<p>Зелень чрезвычайно востребована как среди обычных людей, так и среди владельцев пищевых организаций — ресторанов, кафе, закусочных и столовых. Если ваша деятельность связана с сельским хозяйством или ресторанным бизнесом, то вам просто необходимо иметь постоянного, надежного поставщика упаковочной продукции.</p>\r\n<p>Наша упаковка для зелени отвечает всем нормам качества и безопасности. Она помогает сохранить не только свежесть товара, но и его полезные свойства, а также вкус и аромат. Оригинальные решения создания упаковочного материала внесут изюминку в ваш бизнес, сделают его намного выгодней и интересней. <strong>Упаковка для зелени </strong>«Флорис Пак» выполнена из безопасных материалов. Она отличается оригинальным дизайном, прочностью и неизменно высоким качеством. Сотрудничество с нами всегда приятно и перспективно!  </p>\r\n<h2>Упаковка для зелени. </h2>\r\n<h2>Конусные.</h2>\r\n<table class="pr" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td align="center" valign="middle">\r\n<p><strong> </strong></p>\r\n</td>\r\n<td align="center" valign="middle">\r\n<p><strong>5000-10000шт.</strong></p>\r\n</td>\r\n<td align="center" valign="middle">\r\n<p><strong>10000-50000шт.</strong></p>\r\n</td>\r\n<td align="center" valign="middle">\r\n<p><strong>50000-100000шт.</strong></p>\r\n</td>\r\n<td align="center" valign="middle">\r\n<p><strong>От 100000шт.</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td align="center" valign="middle">\r\n<p>80х170х350(25мкм)</p>\r\n</td>\r\n<td align="center" valign="middle">\r\