(9, 44, 'Полиэтиленовая упаковка', 'polietilenovaya-upakovka', '', '<p><span style="line-height: 1.3em;">Современная полимерная упаковка творит чудеса, преподнося товар в новом и соблазнительном виде.</span></p>\r\n<p>Упаковка играет важную роль в маркетинге и является идеальным рекламным носителем. С помощью красочной флексопечати на гладкую полимерную поверхность можно нанести рисунок, фирменный логотип, запоминающиеся рекламные слоганы.</p>\r\n<p><img src="templates/florispack/images/10.jpg" border="0" width="258" height="400" style="float: right;" />Перечислить все достоинства <strong>полиэтиленовой у паковки</strong> – сложная задача, но попробуем указать только главные из них:</p>\r\n<ul>\r\n<li>прочность и эластичность,</li>\r\n<li>разнообразие и эстетичность,</li>\r\n<li><span style="line-height: 1.3em;">высокая степень защиты товара от неблагоприятных воздействий,</span></li>\r\n<li><span style="line-height: 1.3em;">простота хранения и транспортировки,</span></li>\r\n<li>экологическая безопасность,</li>\r\n<li>химическая нейтральность,</li>\r\n<li>отсутствие запаха,</li>\r\n<li>экономичность.</li>\r\n</ul>\r\n<p>Помимо полиэтиленовой упаковки, мы с удовольствием предоставим вам несколько модификаций пакетов «Европодвес», а также упаковку:</p>\r\n<ul>\r\n<li>для живых цветов в горшках (из полипропилена),</li>\r\n<li>для свежей зелени,</li>\r\n<li>для канцелярских изделий,</li>\r\n<li>для изделий из текстиля,</li>\r\n<li>для компактных дисков.</li>\r\n</ul>\r\n<p>Упаковка стандартных видов будет выполнена для вас на заказ в кратчайшие сроки. Новые и постоянные клиенты могут с успехом воспользоваться системой скидок, а также приобрести нашу продукцию по специальным ценам для партий, превышающих 100 000 штук.</p>', '', 1, 0, 0, 2, '2013-06-11 03:27:07', 734, '', '2016-09-13 11:07:48', 734, 0, '0000-00-00 00:00:00', '2013-06-11 03:27:07', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 11, 0, 4, '', '', 1, 5805, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(10, 45, 'Упаковка для компакт дисков', 'upakovka-dlya-kompakt-diskov', '', '<p>На сегодняшний день компания является одним из крупнейших поставщиков упаковочной продукции от лучших производителей Италии, Польши, Дании, Германии, Голландии и Таиланда. Обширная география сотрудничества позволяет нам комбинировать ассортимент из товаров отечественного и импортного производства, для того чтобы Вы могли выбрать самые оригинальные идеи и решения для Вашего цветочного магазина.</p>', '', 1, 0, 0, 2, '2013-06-11 03:27:24', 734, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2013-06-11 03:27:24', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, 15, '', '', 1, 34, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(11, 46, 'Полипропиленовая упаковка', 'polipropilenovaya-upakovka', '', '<p><span style="line-height: 1.3em;">Чтобы хранить или перевозить какие-либо вещи, нужна качественная пленка, которая способна выдерживать механическое повреждение и защищать упакованные предметы. На сегодняшний день особой популярностью пользуется полипропилен – синтетический материал, который мало подвержен вредному влиянию влаги, температуры и трения. По этой причине </span>полипропиленовая упаковка<span style="line-height: 1.3em;"> все чаще используется для обертывания различных предметов для их надежного хранения и перемещения.</span></p>\r\n<p>Упаковка, сделанная из такого материала, идеально подходит для хранения каких-либо домашних предметов, например, неиспользуемых ковровых покрытий, различной одежды, картин, посуды. Но, кроме того, такой тип пленки может использоваться и в промышленном назначении, к примеру, для транспортировки материалов, при осуществлении офисных переездов или для хранения складских запасов.</p>\r\n<p>Любая упаковка из полипропилена способна защитить завернутые в нее предметы, а потому у вас не будет возникать необоснованных переживаний по поводу того, что вещи будут испорчены из-за воздействия факторов со стороны внешней среды. Полипропиленовая пленка, предлагаемая нашей компанией, изготавливается с применением самых современных технологий и использованием наиболее качественных материалов. Мы гарантируем вам, что наша продукция прослужит вам длительный период времени и при этом не принесет разочарования от ее использования. Звоните прямо сейчас – мы всегда рады ответить на все ваши вопросы! </p>\r\n<p> </p>\r\n<h2>Прозрачные конусные пакеты</h2>\r\n<p><img src="images/con1.jpg" border="0" width="117" height="146" /></p>\r\n<table class="pr" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td align="center" valign="bottom">\r\n<p> </p>\r\n</td>\r\n<td align="center" valign="bottom">\r\n<p> <strong>1000-2000шт.</strong></p>\r\n</td>\r\n<td align="center" vali