(12, 47, 'Полипропиленовая пленка', 'polipropilenovaya-plenka', '', '<p><span style="line-height: 1.3em;"><img src="templates/florispack/images/13.jpeg" border="0" width="223" height="167" style="border: 0; float: right;" /><strong>Компания ФлорисПак – крупнейший поставщик полипропиленовой упаковки</strong>. Мы реализуем упаковочную продукцию, выполненную из полипропиленовой пленки ведущих производителей.</span></p>\r\n<h2>Полипропиленовая пленка: основные характеристики</h2>\r\n<p>Выпускаемая из высококачественного сырья знаменитыми мировыми нефтехимическими компаниями полипропиленовая пленка для упаковки обладает уникальными свойствами. Для нее характерны высокая прозрачность, механическая прочность и надежность сварного шва, превосходные барьерные свойства.</p>\r\n<p>Полипропиленовая пленка наделена отменным блеском, прекрасным внешним видом. Ее достоинства заключаются в повышенной стойкости к жирам и кислотам, в отличной способности к металлизации, термической сварке, к нанесению всевозможных видов печати.</p>\r\n<p>При необходимости полипропиленовая пленка для упаковки подвергается многоцветной флексографической печати и микроперфорации, благодаря которой продукция упаковывается в нее в горячем виде. Компания ФлорисПак оказывает услугу по нанесению на пленку флексографической печати, что позволяет клиентам получить уникальную упаковку.</p>\r\n<h2>Полипропиленовая пленка: сфера применения</h2>\r\n<p>Зачастую качественная полипропиленовая пленка, купить которую можно в компании ФлорисПак. Основное же ее назначение – выпуск гибкой упаковочной продукции, в том числе европодвесов.</p>\r\n<p><strong>Полипропиленовая пленка с успехом используется для гибкой упаковки:</strong></p>\r\n<ul>\r\n<li>\r\n<p>хлебобулочной продукции;</p>\r\n</li>\r\n<li>\r\n<p>текстиля и одежды;</p>\r\n</li>\r\n<li>\r\n<p>кондитерских изделий, свежей зелени, макарон и бакалеи;</p>\r\n</li>\r\n<li>\r\n<p>канцелярских товаров, компактных дисков.</p>\r\n</li>\r\n<li>\r\n<p>Подарков и живых цветов (свежесрезанных и в горшках).</p>\r\n</li>\r\n</ul>\r\n<h2>Пленка прозрачная</h2>\r\n<p><img src="images/pl1.png" border="0" width="180" height="179" style="border: 0;" /> <img src="images/pl2.png" border="0" width="180" height="180" style="border: 0;" /> <img src="images/pl3.png" border="0" width="180" height="180" style="border: 0;" /></p>\r\n<p> </p>\r\n<table class="pr" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td valign="top" width="285">\r\n<p><strong>от 500 до 1000 мм, от 30 до 40 мкм)</strong></p>\r\n</td>\r\n<td width="117">\r\n<p align="center"><strong>1-5шт.</strong></p>\r\n</td>\r\n<td valign="bottom" width="109">\r\n<p align="right"><strong>10-50шт.</strong></p>\r\n</td>\r\n<td valign="bottom" width="109">\r\n<p align="right"><strong>50-100шт.</strong></p>\r\n</td>\r\n<td valign="bottom" width="113">\r\n<p align="right"><strong>Крупный опт</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top" width="285">\r\n<p>Пленка прозрачная ролик 280 гр.</p>\r\n</td>\r\n<td width="117">\r\n<p align="center">60,00р.</p>\r\n</td>\r\n<td valign="bottom" width="109">\r\n<p align="right">53,00р.</p>\r\n</td>\r\n<td valign="bottom" width="109">\r\n<p align="right">50,00р.</p>\r\n</td>\r\n<td valign="bottom" width="113">\r\n<p align="right"><strong>43,00р.</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top" width="285">\r\n<p>Пленка прозрачная(ролик 380 гр.</p>\r\n</td>\r\n<td width="117">\r\n<p align="center">80,00р.</p>\r\n</td>\r\n<td valign="bottom" width="109">\r\n<p align="right">72,00р.</p>\r\n</td>\r\n<td valign="bottom" width="109">\r\n<p align="right">65,00р.</p>\r\n</td>\r\n<td valign="bottom" width="113">\r\n<p align="right"><strong>56,00р.</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top" width="285">\r\n<p><strong>Пленка прозрачная метражом</strong></p>\r\n</td>\r\n<td width="117">\r\n<p align="center"><strong>1-5шт.</strong></p>\r\n</td>\r\n<td valign="bottom" width="109">\r\n<p align="right"><strong>10-50шт.</strong></p>\r\n</td>\r\n<td valign="bottom" width="109">\r\n<p align="right"><strong>50-100шт.</strong></p>\r\n</td>\r\n<td valign="bottom" width="113">\r\n<p align="right"><strong>Крупный опт</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top" width="285">\r\n<p>Пленка прозрачная ролик 700х50м(30мкм)</p>\r\n</td>\r\n<td width="117">\r\n<p align="center">205,00р.</p>\r\n</td>\r\n<td valign="bottom" width="109">\r\n<p align="right">190,00р.</p>\r\n</td>\r\n<td valign="bottom" width="109">\r\n<p align="right">175,00р.</p>\r\n</td>\r\n<td valign="bottom" width="113">\r\n<p align="right"><strong>145,00р.</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top" width="285">\r\n<p>Пленка прозрачная ролик 700х20м(30мкм)</p>\r\n</td>\r\n<td width="117">\r\n<p align="center">85,00р.</p>\r\n</td>\r\n<td valign="bottom" width="109">\r\n<p align="right">80,00р.</p>\r\n</td>\r\n<td valign="bottom" width="109">\r\n<p align="right">70,00р.</p>\r\n</td>\r\n<td valign="bottom" width="113">\r\n<p align="right"><strong>57,00р.</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top" width="285">\r\n<p>Пленка прозрачная ролик 800х20м(30мкм)</p>\r\n</td>\r\n<td width="117">\r\n<p align="center">100,00р.</p>\r\n</td>\r\n<td valign="bottom" width="109">\r\n<p align="right">90,00р.</p>\r\n</td>\r\n<td valign="bottom" width="109">\r\n<p align="right">80,00р.</p>\r\n</td>\r\n<td valign="bottom" width="113">\r\n<p align="right"><strong>70,00р.</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top" width="285">\r\n<p>Пленка прозрачная ролик 800х50м(30мкм)</p>\r\n</td>\r\n<td width="117">\r\n<p align="center">235,00р.</p>\r\n</td>\r\n<td valign="bottom" width="109">\r\n<p align="right">225,00р.</p>\r\n</td>\r\n<td valign="bottom" width="109">\r\n<p align="right">200,00р.</p>\r\n</td>\r\n<td valign="bottom" width="113">\r\n<p align="right"><strong>175,00р.</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top" width="285">\r\n<p>Пленка прозрачная ролик 960х20м(35мкм)</p>\r\n</td>\r\n<td width="117">\r\n<p align="center">180,00р.</p>\r\n</td>\r\n<td valign="bottom" width="109">\r\n<p align="right">170,00р.</p>\r\n</td>\r\n<td valign="bottom" width="109">\r\n<p align="right">145,00р.</p>\r\n</td>\r\n<td valign="bottom" width="113">\r\n<p align="right"><strong>230,00р.</strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>Возможно нанесение логотипа заказчика:</strong></p>\r\n<p><strong><img src="images/pl0.png" border="0" width="450" height="401" /></strong></p>\r\n<p> </p>\r\n<div id="dc_vk_code" style="display: none;"> </div>', '', 1, 0, 0, 8, '2013-06-11 03:28:04', 734, '', '2016-09-13 14:41:38', 734, 0, '0000-00-00 00:00:00', '2013-06-11 03:28:04', '0000-00-00 00:00:00', '{"image_intro":"images\\/8.png","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 22, 0, 2, '', '', 1, 6939, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(13, 48, 'Для канцелярских товаров', 'dlya-kantselyarskikh-tovarov', '', '<p>На сегодняшний день компания является одним из крупнейших поставщиков упаковочной продукции от лучших производителей Италии, Польши, Дании, Германии, Голландии и Таиланда. Обширная география сотрудничества позволяет нам комбинировать ассортимент из товаров отечественного и импортного производства, для того чтобы Вы могли выбрать самые оригинальные идеи и решения для Вашего цветочного магазина.</p>', '', 1, 0, 0, 2, '2013-06-11 03:28:37', 734, '', '0000-00-00 00:00:00', 0, 734, '2016-09-13 10:28:07', '2013-06-11 03:28:37', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, 12, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
