(14, 49, 'Упаковка для цветов', 'dlya-tsvetov', '', '<p><img src="templates/florispack/images/pompak.jpg" border="0" width="257" height="175" style="float: left; border: 0; margin: 5px;" /></p>\r\n<p>Всем известно, что любой товар при транспортировке должен быть тщательным образом упакован во избежание воздействия на него вредного влияния окружающего микроклимата. Особенно это касается тех предметов, которые очень подвержены механическому повреждению, например живые цветы. Правильно организованная забота о своей продукции позволит вам сохранить денежные средства, вложенные в нее, а, соответственно, и приумножить их.</p>\r\n<p>Для правильной транспортировки живых цветов, а также их последующей продажи используется пленка для упаковки цветов, которая является надежной защитой для всех растений. Наша компания готова предоставить вам уникальную возможность сохранить закупаемый вами товар и доставить его до покупателей в целости и сохранности. Мы являемся крупным поставщиком упаковочной пленки от ведущих ее производителей, а потому гарантируем вам, что живые цветы, имеющие подобную защиту, на продолжении длительного времени будут иметь прекрасный внешний вид и смогут сохранить свою привлекательность и восхитительный аромат.</p>\r\n<p>Если вам необходима пленка для упаковки цветов – не медлите, обратитесь к нашим специалистам за помощью. В самые кратчайшие сроки мы предоставим вам качественную упаковку, которая защитит ваших «зеленых друзей» от механического воздействия и вредных климатических условий, а вам доставит радость от того, что вы смогли организовать их качественную перевозку. <img src="templates/florispack/images/floris.jpg" border="0" width="213" height="187" style="float: right;" /></p>', '', 1, 0, 0, 2, '2013-06-11 03:28:49', 734, '', '2013-07-08 11:25:43', 734, 0, '0000-00-00 00:00:00', '2013-06-11 03:28:49', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 4, 0, 11, '', '', 1, 1914, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(15, 50, 'Полипропиленовые пакеты для упаковки', 'polipropilenovye-pakety', '', '<p><span style="line-height: 1.3em;"><img src="templates/florispack/images/14.jpg" border="0" width="250" style="float: right; border: 0;" />Компания ФлорисПак предлагает полипропиленовые пакеты для упаковки собственного производства. Для вас мы производим высококачественные упаковочные материалы на протяжении почти 20 лет.</span></p>\r\n<p>Сотрудничая непосредственно с производителем, вы получите товар по выгодной оптовой цене и в сжатые сроки.</p>\r\n<p><strong>Преимущества пакетов из полипропиленовой пленки:</strong></p>\r\n<ul>\r\n<li>\r\n<p>Прочность и повышенная прозрачность нашей упаковки по сравнению с остальными полимерами.</p>\r\n</li>\r\n<li>\r\n<p>Возможность применения флексографической печати с рисунком по вашему выбору.</p>\r\n</li>\r\n<li>\r\n<p>Устойчивость к отрицательным температурам. Поэтому пакеты можно использовать в любой сезон.</p>\r\n</li>\r\n</ul>\r\n<p><img src="templates/florispack/images/15.png" border="0" width="251" height="232" style="float: left; border: 0;" />Заслуженной популярностью у клиентов пользуются полипропиленовые пакеты для упаковки типа «Европодвес». Они являются современным «золотым стандартом» для презентационных целей.</p>\r\n<p><strong>Варианты полипропиленовых пакетов для наших клиентов:</strong></p>\r\n<ul>\r\n<li>\r\n<p>Пакеты «Европодвес» с разнообразным расположением клапана или без него.</p>\r\n</li>\r\n<li>\r\n<p>Клапан с клеевой подложкой на клапане. Выполняется компанией ФлорисПак по вашему желанию.</p>\r\n</li>\r\n<li>\r\n<p>Применение <a href="uslugi/fleksograficheskaya-pechat">флексографической печати</a> с рисунком по трафарету клиента.</p>\r\n</li>\r\n<li>\r\n<p>Индивидуальный дизайн, размер пакета. Мы всегда конструктивно подходим к пожеланиям клиентов.</p>\r\n</li>\r\n</ul>\r\n<p><span style="line-height: 1.3em;">Вам достаточно, не отрываясь от компьютера, позвонить нам и заказать полипропиленовые пакеты для упаковки своего товара. Наша компания готова предложить клиентам упаковку и пакеты оптом уже от 1000 единиц. Звоните нам прямо сейчас по телефону +7 (812) 496 22 84 , мобильный телефон: +7 (904) 515 90 06. Профессионалы ФлорисПак помогут вам на всех этапах сделки.</span></p>\r\n<p> </p>\r\n<h2>Прозрачные конусные пакеты</h2>\r\n<p><img src="images/con1.jpg" border="0" width="117" height="146" /></p>\r\n<table class="pr" width="100%" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td align="center" valign="bottom">\r\n<p> </p>\r\n</td>\r\n<td align="center" valign="bottom">\r\n<p> <strong>1000-2000шт.</strong></p>\r\n</td>\r\n<td align="center" valign="bottom">\r\n<p> <strong>2000-3000шт.</strong></p>\r\n</td>\r\n<td align="center" valign="bottom">\r\n<p> <strong>3000-5000шт.</strong></p>\r\n</td>\r\n<td align="center" valign="bottom">\r\n<p> <strong>От 5000шт.</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td align="center" valign="bottom">\r\n<p>8 /15 / 60</p>\r\n</td>\r\n<td align="center" valign="bottom">\r\n<p>1,05р.</p>\r\n</td>\r\n<td align="center" valign="bottom">\r\n<p>1,00р.</p>\r\n</td>\r\n<td align="center" valign="bottom">\r\n<p>0,95р.</p>\r\n</td>\r\n<td align="center" valign="bottom">\r\n<p>0,90р.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td align="center" valign="bottom">\r\n<p>8 /15 / 70</p>\r\n</td>\r\n<td align="center" valign="bottom">\r\n<p>1,10р.</p>\r\n</td>\r\n<td align="center" valign="bottom">\r\n<p>1,05р.</p>\r\n</td>\r\n<td align="center" valign="bottom">\r\n<p>1,00р.</p>\r\n</td>\r\n<td align="center" valign="bottom">\r\n<p>0,95р.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td align="center" valign="bottom">\r\n<p>8 /21 / 80</p>\r\n</td>\r\n<td align="center" valign="bottom">\r\n<p>1,40р.</p>\r\n</td>\r\n<td align="center" valign="bottom">\r\n<p>1,35р.</p>\r\n</td>\r\n<td align="center" valign="bottom">\r\n<p>1,30р.</p>\r\n</td>\r\n<td align="center" valign="bottom">\r\n<p>1,25р.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td align="center" valign="bottom">\r\n<p>8 /27 / 50<