(16, 51, 'Для текстиля', 'dlya-tekstilya', '', '<p>На сегодняшний день компания является одним из крупнейших поставщиков упаковочной продукции от лучших производителей Италии, Польши, Дании, Германии, Голландии и Таиланда. Обширная география сотрудничества позволяет нам комбинировать ассортимент из товаров отечественного и импортного производства, для того чтобы Вы могли выбрать самые оригинальные идеи и решения для Вашего цветочного магазина.</p>', '', 1, 0, 0, 2, '2013-06-11 03:29:45', 734, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2013-06-11 03:29:45', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, 9, '', '', 1, 20, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(17, 52, 'Упаковка с европодвесом', 's-evropodvesom', '', '<p>Пакеты с европодвесом или еврослотом – это уникальное решение в маркетинговой деятельности. Они помогают демонстрировать вашим покупателям и клиентам важную продукцию небольшого размера. В верхней части упаковка с европодвесом имеет прорезь в виде петли, которая помогает крепить товары на крючки демонстрационных стоек. Продукция, таким образом, оказывается в подвешенном состоянии стопкой одна за другой.</p>\r\n<table width="100%" border="0" cellspacing="10" cellpadding="5">\r\n<tbody>\r\n<tr>\r\n<td valign="top" width="320">\r\n<p><img src="images/184.JPG" border="0" alt="пакет с еврослотом и клапаном" width="310" height="250" style="display: block; margin-left: auto; margin-right: auto;" /></p>\r\n</td>\r\n<td valign="top" width="320">\r\n<p><img src="images/pakety-s-evroslotom5.jpg" border="0" alt="пакет с еврослотом и скотч клапаном" width="310" height="250" style="display: block; margin-left: auto; margin-right: auto;" /></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h2>Преимущества европодвеса</h2>\r\n<ul>\r\n<li>продукцию удобно осматривать и выбирать;</li>\r\n<li>снимается такая упаковка очень легко;</li>\r\n<li>внешний вид продукции очень эстетичен;</li>\r\n<li>это идеальное решение для выкладки ваших товаров в крупных магазинах.</li>\r\n</ul>\r\n<p><em><strong>Данную упаковку мы предлагаем по вашему выбору:</strong></em></p>\r\n<ul>\r\n<li>с клапаном вверху, внизу или без него;</li>\r\n</ul>\r\n<ul>\r\n<li>с нанесением на клапан клеевого слоя или без него;</li>\r\n</ul>\r\n<ul>\r\n<li>обычный еврослот (петля для подвешивания) или усиленный;</li>\r\n</ul>\r\n<ul>\r\n<li>с рисунком или с печатью флексографией логотипа вашей компании;</li>\r\n</ul>\r\n<ul>\r\n<li>с применением любых нестандартных решений.</li>\r\n</ul>\r\n<h2>Для каких товаров производится европодвес</h2>\r\n<p>Европодвесы используют чаще для легких и не слишком объемных товаров:</p>\r\n<ul>\r\n<li>канцелярская и офисная продукция (календари, краски, кисти, карандаши, мел, скрепки и др.);</li>\r\n</ul>\r\n<ul>\r\n<li>текстильная продукция (колготы, носки, белье и т. п.);</li>\r\n</ul>\r\n<ul>\r\n<li>бижутерия (заколки, резинки, шпильки, украшения и др.);</li>\r\n</ul>\r\n<ul>\r\n<li>пищевые продукты (сухая рыба, конфеты и др.);</li>\r\n</ul>\r\n<ul>\r\n<li>одноразовые товары (вилки, ложки, зубочистки, тарелки и т. п.).</li>\r\n</ul>\r\n<p>Если вы ищете оптимальную презентацию вашего товара потребителям, <strong>упаковка с европодвесом</strong> – это то, что вам нужно. Купить ее можно по оптовым ценам уже начиная с 1000 штук. Закажите нашу продукцию или получите подробную консультацию у менеджера по телефонам в г. Санкт-Петербург: тел./факс: +7 (812) 496 22 84 или моб.: +7 (904) 515 90 06.</p>\r\n<p><strong>Мы стремимся к длительному сотрудничеству с вами! </strong></p>\r\n<p> </p>', '', 1, 0, 0, 8, '2013-06-11 03:30:15', 734, '', '2016-09-13 11:12:07', 734, 0, '0000-00-00 00:00:00', '2013-06-11 03:30:15', '0000-00-00 00:00:00', '{"image_intro":"images\\/2.png","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 22, 0, 8, '', '', 1, 6976, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(18, 53, 'Полипропиленовые пакеты с клеевым клапаном', 's-kleevym-klaponom', '', '<p>Если у вас есть необходимость использовать полипропиленовые пакеты с клеевым клапаном, мы рады предложить вам нашу продукцию, которая отличается высокой степень качества и привлекательности. С ее помощью вы можете представлять свои товары конечному потребителю, поскольку такие пакеты чрезвычайно надежны и удобны.</p>\r\n<p>Материалом изготовления является полимер пропилена, который отличается такими положительными характеристиками как:</p>\r\n<ul>\r\n<li>стойкость к истиранию, а потому пакеты имеют длительный срок их эксплуатации;</li>\r\n<li>термостойкость, вследствие чего он начинает плавиться только при достаточно высокой температуре;</li>\r\n<li>стойкость к химическим реагентам, поскольку на него могут повлиять только сильные кислоты;</li>\r\n<li>водостойкость, благодаря которой пакеты могут быть использованы не только внутри помещений, но и за пределами их стен.</li>\r\n</ul>\r\n<p>Полипропиленовые пакеты с клеевым клапаном используются для упаковки различных предметов, таких как, газеты и журналы, канцелярские принадлежности, игрушки или сувениры. Наша компания готова предоставить вам продукцию, которая будет не только качественной, но и красивой, поскольку на пакеты можно нанести логотип вашей компании либо какое-то красивое изображение. Кроме того, мы имеем возможность изготовить полипропиленовые пакеты с клеевым слоем по индивидуальному заказу в соответствии с необходимыми вам размерами упаковочного материала.</p>\r\n<p><strong>Виды наших пакетов</strong></p>\r\n<table width="100%" border="0" cellspacing="10" cellpadding="5">\r\n<tbody>\r\n<tr>\r\n<td valign="top" width="320"><img src="images/1731842.jpeg" border="0" alt="с клеевым клапаном" width="350" height="240" style="float: left;" /></td>\r\n<td valign="top" width="320"><img src="images/PC260071.JPG" border="0" alt="с клеевым слоем" width="317" height="240" style="float: right;" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Позвоните нам прямо сейчас – и вы получите качественный товар по доступным ценам!  </p>', '', 1, 0, 0, 8, '2013-06-11 03:30:36', 734, '', '2016-09-13 11:13:50', 734, 0, '0000-00-00 00:00:00', '2013-06-11 03:30:36', '0000-00-00 00:00:00', '{"image_intro":"images\\/4.png","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 8, 0, 7, '', '', 1, 6543, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(19, 54, 'Упаковка цветов и подарков', 'upakovka-tsvetov-i-podarkov', '', '<p><img src="templates/florispack/images/17.jpg" border="0" width="230" style="float: right;" />Упаковка цветов и подарков придаст товару стильный внешний вид, а также послужит гарантией его сохранности при транспортировке и складировании.</p>\r\n<p>Компания ФлорисПак является производителем упаковочной продукции из полипропиленовой пленки, поэтому, работая с нами, вы гарантированно получите товар без дополнительных финансовых «накруток», которые неизбежны при работе с посредниками.</p>\r\n<p>При вашем желании мы придадим индивидуальность, отгружаемой продукции, нанеся понравившейся вам логотип или рисунок методом флексографической печати на своем оборудовании.</p>\r\n<p>Таким образом, вы существенно сэкономите, заказав две услуги непосредственно у компании – производителя.</p>\r\n<h2>Предлагается оригинальная упаковка цветов и подарков для вашего бизнеса:</h2>\r\n<ul>\r\n<li>Продукция для розничного цветочного бизнеса. Применение полипропиленовой упаковки принесет вам дополнительную прибыль за счет повышения привлекательности товара и увеличения срока его хранения, а, значит, и реализации. Продукция, которую вы раньше отправляли в мусор, сохранит свои свойства, благодаря, упаковке от компании ФлорисПак.</li>\r\n<li>Продажа живых цветов в горшках. Этот бизнес набирает обороты и, соответственно, растет его доходность. Потребителями являются розничные торговые сети, специализированные магазины. Живые цветы, надежно упакованные нашей компанией, сохранят товарный вид намного дольше.</li>\r\n<li>Если ваш бизнес – производство или сбыт сувениров и подарков, вам известно, что красиво упакованный товар, можно продать с большей прибылью. Дополнительное оформление упаковки – картинки или логотипы, нанесенные при помощи флексографической печати, сделает вашу продукцию более привлекательной для клиентов.</li>\r\n</ul>\r\n<p>Компания ФлорисПак приглашает вас к сотрудничеству. Чтобы оценить, как выглядит упаковка цветов и подарков достаточно обратиться к нашему менеджеру и посетить демонстрационный зал.</p>\r\n<p>Позвоните нам по телефонам +7 (812) 4962284 или мобильный телефон: +7 (904) 5159006. Это будет началом долговременного сотрудничества.</p>', '', 1, 0, 0, 2, '2013-06-11 03:31:21', 734, '', '2013-06-25 11:28:25', 734, 0, '0000-00-00 00:00:00', '2013-06-11 03:31:21', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 9, 0, 6, '', '', 1, 3738, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(20, 55, 'Флексографическая печать', 'fleksograficheskaya-pechat', '', '<p><strong><img src="templates/florispack/images/flexo.jpg" border="0" width="276" height="207" style="border: 0; float: right;" />&#1060;&#1083;&#1077;&#1082;&#1089;&#1086;&#1075;&#1088;&#1072;&#1092;&#1080;&#1095;&#1077;&#1089;&#1082;&#1072;&#1103; &#1087;&#1077;&#1095;&#1072;&#1090;&#1100;</strong> &#8212; &#1101;&#1090;&#1086; &#1086;&#1089;&#1086;&#1073;&#1099;&#1081; &#1084;&#1077;&#1090;&#1086;&#1076; &#1087;&#1077;&#1095;&#1072;&#1090;&#1080; &#1089; &#1087;&#1088;&#1080;&#1084;&#1077;&#1085;&#1077;&#1085;&#1080;&#1077;&#1084; &#1075;&#1080;&#1073;&#1082;&#1080;&#1093; &#1087;&#1083;&#1077;&#1085;&#1086;&#1095;&#1085;&#1099;&#1093; &#1084;&#1072;&#1090;&#1077;&#1088;&#1080;&#1072;&#1083;&#1086;&#1074;, &#1082;&#1072;&#1088;&#1090;&#1086;&#1085;&#1072;, &#1092;&#1086;&#1083;&#1100;&#1075;&#1080; &#1080; &#1078;&#1080;&#1076;&#1082;&#1080;&#1093; &#1082;&#1088;&#1072;&#1089;&#1086;&#1082;. &#160;</p>\r\n<p>&#1056;&#1077;&#1074;&#1086;&#1083;&#1102;&#1094;&#1080;&#1086;&#1085;&#1085;&#1099;&#1084; &#1101;&#1090;&#1072;&#1087;&#1086;&#1084; &#1084;&#1086;&#1078;&#1085;&#1086; &#1089;&#1095;&#1080;&#1090;&#1072;&#1090;&#1100; &#1092;&#1083;&#1077;&#1082;&#1089;&#1086;&#1087;&#1077;&#1095;&#1072;&#1090;&#1100; &#1085;&#1072; &#1087;&#1083;&#1077;&#1085;&#1082;&#1077; &#1080; &#1087;&#1088;&#1086;&#1080;&#1079;&#1074;&#1086;&#1076;&#1089;&#1090;&#1074;&#1086; &#1092;&#1088;&#1072;&#1085;&#1094;&#1091;&#1079;&#1089;&#1082;&#1086;&#1081; &#1082;&#1086;&#1084;&#1087;&#1072;&#1085;&#1080;&#1077;&#1081; &#171;&#1057;. &#1040;. &#1062;&#1077;&#1083;&#1083;&#1086;&#1092;&#1072;&#1085;&#187; &#1091;&#1087;&#1072;&#1082;&#1086;&#1074;&#1086;&#1095;&#1085;&#1086;&#1075;&#1086; &#1084;&#1072;&#1090;&#1077;&#1088;&#1080;&#1072;&#1083;&#1072; &#1089; &#1082;&#1072;&#1088;&#1090;&#1080;&#1085;&#1082;&#1072;&#1084;&#1080;, &#1085;&#1072;&#1085;&#1077;&#1089;&#1077;&#1085;&#1085;&#1099;&#1084;&#1080; &#1072;&#1085;&#1080;&#1083;&#1080;&#1085;&#1086;&#1074;&#1099;&#1084;&#1080; &#1082;&#1088;&#1072;&#1089;&#1082;&#1072;&#1084;&#1080;. &#1069;&#1090;&#1086; &#1089;&#1083;&#1091;&#1095;&#1080;&#1083;&#1086;&#1089;&#1100; &#1074; &#1085;&#1072;&#1095;&#1072;&#1083;&#1077; 20 &#1074;&#1077;&#1082;&#1072;.&#160;</p>\r\n<p>&#1060;&#1083;&#1077;&#1082;&#1089;&#1086;&#1075;&#1088;&#1072;&#1092;&#1080;&#1095;&#1077;&#1089;&#1082;&#1072;&#1103; &#1087;&#1077;&#1095;&#1072;&#1090;&#1100; &#1086;&#1090;&#1083;&#1080;&#1095;&#1072;&#1077;&#1090;&#1089;&#1103; &#1089;&#1083;&#1077;&#1076;&#1091;&#1102;&#1097;&#1080;&#1084;&#1080; &#1087;&#1088;&#1077;&#1080;&#1084;&#1091;&#1097;&#1077;&#1089;&#1090;&#1074;&#1072;&#1084;&#1080;:</p>\r\n<ul>\r\n<li>&#1064;&#1080;&#1088;&#1086;&#1082;&#1080;&#1081; &#1074;&#1099;&#1073;&#1086;&#1088; &#1085;&#1086;&#1089;&#1080;&#1090;&#1077;&#1083;&#1077;&#1081; &#1076;&#1083;&#1103; &#1087;&#1077;&#1095;&#1072;&#1090;&#1080;. &#1042; &#1086;&#1089;&#1085;&#1086;&#1074;&#1085;&#1086;&#1084; &#1080;&#1089;&#1087;&#1086;&#1083;&#1100;&#1079;&#1091;&#1077;&#1090;&#1089;&#1103; &#1087;&#1086;&#1083;&#1080;&#1101;&#1090;&#1080;&#1083;&#1077;&#1085; &#1080; &#1087;&#1086;&#1083;&#1080;&#1087;&#1088;&#1086;&#1087;&#1080;&#1083;&#1077;&#1085;. &#1058;&#1072;&#1082;&#1078;&#1077; &#1084;&#1086;&#1078;&#1085;&#1086; &#1087;&#1088;&#1080;&#1084;&#1077;&#1085;&#1103;&#1090;&#1100; &#1092;&#1086;&#1083;&#1100;&#1075;&#1091; &#1080;&#1083;&#1080; &#1082;&#1072;&#1088;&#1090;&#1086;&#1085;.</li>\r\n<li>&#1055;&#1088;&#1080;&#1084;&#1077;&#1085;&#1077;&#1085;&#1080;&#1077; &#1091;&#1089;&#1090;&#1086;&#1081;&#1095;&#1080;&#1074;&#1099;&#1093; &#1082;&#1088;&#1072;&#1089;&#1080;&#1090;&#1077;&#1083;&#1077;&#1081;.</li>\r\n<li>&#1054;&#1073;&#1098;&#1077;&#1076;&#1080;&#1085;&#1077;&#1085;&#1080;&#1077; &#1074; &#1086;&#1076;&#1080;&#1085; &#1090;&#1077;&#1093;&#1085;&#1086;&#1083;&#1086;&#1075;&#1080;&#1095;&#1077;&#1089;&#1082;&#1080;&#1081; &#1087;&#1088;&#1086;&#1094;&#1077;&#1089;&#1089; &#1083;&#1072;&#1084;&#1080;&#1085;&#1080;&#1088;&#1086;&#1074;&#1072;&#1085;&#1080;&#1103;, &#1086;&#1073;&#1098;&#1077;&#1084;&#1085;&#1086;&#1081; &#1093;&#1091;&#1076;&#1086;&#1078;&#1077;&#1089;&#1090;&#1074;&#1077;&#1085;&#1085;&#1086;&#1081; &#1096;&#1090;&#1072;&#1084;&#1087;&#1086;&#1074;&#1082;&#1080; &#1080; &#1089;&#1082;&#1083;&#1077;&#1080;&#1074;&#1072;&#1085;&#1080;&#1103; &#1080;&#1079;&#1076;&#1077;&#1083;&#1080;&#1081;.</li>\r\n<li>&#1041;&#1099;&#1089;&#1090;&#1088;&#1072;&#1103; &#1079;&#1072;&#1084;&#1077;&#1085;&#1072; &#1087;&#1077;&#1095;&#1072;&#1090;&#1085;&#1099;&#1093; &#1092;&#1086;&#1088;&#1084; &#1074;&#1086; &#1092;&#1083;&#1077;&#1082;&#1089;&#1086;&#1075;&#1088;&#1072;&#1092;&#1080;&#1095;&#1077;&#1089;&#1082;&#1086;&#1081; &#1084;&#1072;&#1096;&#1080;&#1085;&#1077;.</li>\r\n</ul>\r\n<p><strong>&#1050;&#1086;&#1084;&#1087;&#1072;&#1085;&#1080;&#1103; &#1060;&#1083;&#1086;&#1088;&#1080;&#1089;&#1055;&#1072;&#1082; &#1088;&#1072;&#1073;&#1086;&#1090;&#1072;&#1077;&#1090; &#1076;&#1083;&#1103; &#1074;&#1072;&#1089; &#1089; 1996 &#1075;&#1086;&#1076;&#1072;. &#1052;&#1099; &#1087;&#1088;&#1077;&#1076;&#1083;&#1072;&#1075;&#1072;&#1077;&#1084; &#1082;&#1083;&#1080;&#1077;&#1085;&#1090;&#1072;&#1084; &#1092;&#1083;&#1077;&#1082;&#1089;&#1086;&#1087;&#1077;&#1095;&#1072;&#1090;&#1100; &#1085;&#1072; &#1087;&#1083;&#1077;&#1085;&#1082;&#1077; &#1087;&#1088;&#1080; &#1079;&#1072;&#1082;&#1072;&#1079;&#1077;:</strong></p>\r\n<ul>\r\n<li>&#1059;&#1087;&#1072;&#1082;&#1086;&#1074;&#1082;&#1080; &#1076;&#1083;&#1103; &#1074;&#1072;&#1096;&#1080;&#1093; &#1094;&#1074;&#1077;&#1090;&#1086;&#1074; &#1080; &#1073;&#1091;&#1082;&#1077;&#1090;&#1086;&#1074;.&#160;</li>\r\n<li>&#1059;&#1087;&#1072;&#1082;&#1086;&#1074;&#1082;&#1080; &#1076;&#1083;&#1103; &#1089;&#1074;&#1077;&#1078;&#1077;&#1081; &#1079;&#1077;&#1083;&#1077;&#1085;&#1080; &#1076;&#1083;&#1103; &#1074;&#1072;&#1096;&#1077;&#1075;&#1086; &#1086;&#1074;&#1086;&#1097