(24, 60, 'Пакеты для цветов', 'pakety-dlya-tsvetov', '', '<p>Пакеты для цветов – это важный элемент для оформления цветочных композиций. Поэтому их используют в своей профессиональной деятельности дизайнеры-флористы, продавцы цветочных магазинов и работники свадебных салонов. Совершенствование технологии производства пакетов для цветов достигло такого уровня, что само по себе изделие является яркой деталью, которое способно сгладить некоторые изъяны неудачно составленного букета. А правильно выполненная композиция в сочетании с оригинальной упаковкой только усиливает визуальное восприятие готовой связки.</p>\r\n<h2>Какие виды пакетов предлагает наша компания</h2>\r\n<table width="100%" border="0" cellspacing="5" cellpadding="5">\r\n<tbody>\r\n<tr>\r\n<td valign="top" width="213"><img src="images/1418291.jpg" border="0" alt="В виде бокала для шампанского" width="233" height="233" /></td>\r\n<td valign="top" width="213"><img src="images/1428742217342_bulletin.jpg" border="0" alt="Прямоугольные" width="267" height="233" /></td>\r\n<td valign="top" width="213"><img src="images/878.jpg" border="0" alt="В виде трапеции" width="262" height="229" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Наша компания предлагает большой выбор упаковочной продукции для оформления букетов. Разнообразие форм и оттенков цветочных пакетов удовлетворит пожелания всех клиентов и сделает их флористические композиции еще оригинальнее и привлекательнее. Компания предоставляет следующие варианты упаковок:</p>\r\n<ul>\r\n<li><strong>Прямоугольные пакеты</strong>. Мы производим такие изделия любого размера. Прозрачная пленка в сочетании с декоративным узором создадут легкую привлекательную оболочку, что подчеркнет необходимое настроение – от официального до романтического;</li>\r\n<li><strong>В виде трапеции</strong>. Конусные пакеты придадут элегантности букету и выделят его форму. В сочетании с уникальным орнаментом упаковки готовый комплект получит завершенность художественной композиции и станет более насыщенным;</li>\r\n<li><strong>В виде бокала для шампанского</strong>. Такая форма упаковки особенно актуальна при проведении свадебных торжеств. Оформление в виде бокала станет полноценным украшением праздника и идеально впишется в общую декорацию.</li>\r\n</ul>\r\n<p>Кроме перечисленных видов упаковки для цветов мы предлагаем плайм пакеты или создать новый вариант, который предложит клиент.</p>\r\n<h2>Почему обращаются к нам</h2>\r\n<p>Наша компания является лидером производства пакетов для цветов уже больше двух десятков лет. За это время мы смогли выделить основные критерии нашей деятельности, которые направлены на улучшение сервиса обслуживания и производство качественной продукции. Поэтому, купить пакеты для цветов у нас – это значит приобрести элемент для оформления полноценного произведения искусства.</p>', '', 1, 0, 0, 8, '2016-08-09 06:26:09', 734, '', '2016-09-13 10:50:29', 734, 0, '0000-00-00 00:00:00', '2016-08-09 06:26:09', '0000-00-00 00:00:00', '{"image_intro":"images\\/5.png","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 7, 0, 1, '', '', 1, 100, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(25, 61, 'Упаковка в Санкт-Петербурге', 'upakovka-v-sankt-peterburge', '', '<p>Опрос случайных клиентов крупнейших отечественных торговых сетей, позволил сделать сенсационный и однозначный вывод – упаковка продукции это главный после цены фактор, от которого зависит успех реализации товара. Поэтому, если производитель заинтересован в продаже свой продукции, то стоит задуматься об оформлении и приведении ее в товарный вид при помощи упаковки. Особенно это актуально для поставщиков пищевых продуктов, цветов и канцелярских изделий.</p>\r\n<p>Изготовление упаковки нашей компанией позволяет производителю сделать свой товар конкурентным и более привлекательным.</p>\r\n<h2>Виды нашей упаковки</h2>\r\n<p>{loadposition catalls}</p>\r\n<p>Наша компания более двух десятков лет предоставляет услуги по изготовлению упаковочного материала. Ассортимент продукции незаменим для товаров следующих направлений:</p>\r\n<p>- Цветы в горшках и букетах. Оформление красочных букетов пленкой популярно среди дизайнеров. Кроме того, использование полипропиленовой пленки в качестве упаковки увеличит период хранения цветочных композиций.</p>\r\n<p>- Упаковочная пленка с рисунком. Оборудование компании ФлорисПак позволяет выполнить флексопечать на такой упаковке, что преобразит простые маркеры или фломастеры в оригинальные изделия.</p>\r\n<p>- Упаковка для свежей зелени. Яркий цвет зелени и без посторонней помощи привлекает покупателя, но брендированная упаковочная пленка насытит оттенки и сохранит товар на больший срок.</p>\r\n<p>- Упаковочные пакеты с еврослотом сделают товар презентабельным и солидным.</p>\r\n<p>- Полипропиленовая пленка. Наша компания предлагает свою продукцию и как отдельный товар для удовлетворения потребностей предприятий. Размеры и фон выполняются в соответствии с заказом.</p>\r\n<h2>Преимущества нашей компании</h2>\r\n<p>Мы дорожим каждым клиентом, поэтому делаем упор на индивидуальном подходе к выполнению каждого заказа. Наша продукция отличного качества, что позволило компании много лет работать на рынке предоставления данных услуг и успешно развиваться. Лучшая упаковка в СПБ – это продукция от компании ФлорисПак.</p>\r\n<h3>Дополнительные возможности</h3>\r\n<p>Технологические возможности нашей компании могут сделать упаковку для товара более привлекательной при помощи <a href="uslugi/fleksograficheskaya-pechat">флексопечати</a>. Применение такой технологии обеспечит узнаваемость продукции и поставит ее на новый элитный уровень. Если вы ищете где купить упаковку в СПБ, компания ФлорисПак удовлетворит все ваши запросы.</p>\r\n<p>Заказать упаковку вы можете любым удобным способом, представленным на странице <a href="kontakty">контактов</a>, или воспользоваться формой онлайн заявки.</p>\r\n<p>{loadposition icons}</p>', '', 1, 0, 0, 2, '2016-08-09 08:41:33', 734, '', '2016-09-13 11:49:22', 734, 0, '0000-00-00 00:00:00', '2016-08-09 08:41:33', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 10, 0, 0, '', '', 1, 300, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(26, 63, 'Упаковка для цветов (2)', 'upakovka-dlya-tsvetov-2', '', '<p><img src="templates/florispack/images/18.jpg" border="0" width="200" style="border: 0; float: right;" /><img src="templates/florispack/images/19.jpg" border="0" width="200" style="float: left;" />Яркая, красочная, удобная и функциональная упаковка привлекает внимание покупателей, увеличивает объем продаж товара. МЫ производим все типы упаковки а так же учитываем ваши пожелания.</p>\r\n<p align="justify">Фабрика печати предлагает нашим партнерам и заказчикам широчайший спектр продукции и услуг.</p>\r\n<p align="justify">Нашими специалистами разработано большое количество различных типов упаковки для цветов, да же если у вас не стандартный заказ, мы постараемся вам помочь максимально быстро с сохранением качества продукции.</p>\r\n<p><img src="templates/florispack/images/20.jpg" border="0" width="200" style="float: right; clear: left; border: 0; margin-top: 5pxpx; margin-bottom: 5pxpx;" /></p>\r\n<p align="justify">Кроме того, современные упаковки для продуктов не обязательно являются стандартными, а могут иметь различные формы, в зависимости от фантазии дизайнера. Необычная упаковка помогает выделить товар на прилавке и обратить на него повышенное внимание потребителя.</p>', '', -2, 0, 0, 8, '2013-06-10 16:48:05', 734, '', '2016-09-13 11:04:06', 0, 0, '0000-00-00 00:00:00', '2013-06-10 16:48:05', '0000-00-00 00:00:00', '{"image_intro":"images\\/2.png","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, 0, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
